import React, {Component} from 'react';

import "../../asset/css/global.css"


export default class PageContentWallpaper extends Component {

    constructor(props){
        super(props)
    }
    navigatorLink = (myLink) => {
        window.location.href = "/#" + myLink
    }
    getPageModule =()=>{
        if(typeof this.props.pageModule !=="undefined"){
            return (<a className={""} onClick={()=>this.navigatorLink(this.props.pageModule)}> {this.props.pageModule}</a>)
        }
        return "---"
    }
    getPageMenu =()=>{
        if(typeof this.props.pageModule !=="undefined"){
            return this.props.pageMenu;
        }
        return "---"
    }
    render() {
        return (
            <div className="container pageContentBox">
                <div>
                    <span className="myTitleLogin">{this.getPageModule()}</span>
                    <span>&nbsp;</span>
                    <span> | </span>
                    <span>&nbsp;</span>
                    <span>{this.getPageMenu()}</span>
                </div>
                <hr/>

                {this.props.children}

            </div>

        );
    }
}
